import React from 'react';
import {Link} from 'react-router-dom';

const Toolbar = () => {
    return (
        <div>
        <div className="gap-5">
            <Link to="/gallery">HOME</Link>
            <Link to="/profile">Users</Link>
            <Link to="/login">Login</Link>
            <Link to="/">Register</Link>
        </div>
        </div>
    )
}

export default Toolbar;
